:[1] Das ''Neuron'' bei Säugetieren ist auf die Aufnahme und Verarbeitung von Signalen spezialisiert.
:[1] „Jedes Lebewesen, das mehr als hundert ''Neuronen'' besitzt, möchte frei sein.“<ref>{{Literatur| Autor= Vince Ebert | Titel= Machen Sie sich frei! | TitelErg= Sonst tut es keiner für Sie| Verlag= Rowohlt Taschenbuch Verlag |Ort= Reinbek | Jahr= 2011 | ISBN= 978-3-499-62651-7 | Seiten= 14.}}</ref>
