== ausfallen ({{Sprache|Deutsch}}) ==
=== {{Wortart|Verb|Deutsch}} ===

{{Deutsch Verb Übersicht
|Präsens_ich=falle aus
|Präsens_du=fällst aus
|Präsens_er, sie, es=fällt aus
|Präteritum_ich=fiel aus
|Partizip II=ausgefallen
|Konjunktiv II_ich=fiele aus
|Imperativ Singular=falle aus
|Imperativ Plural=fallt aus
|Hilfsverb=sein
}}

{{Worttrennung}}
:aus·fal·len, {{Prät.}} fiel aus, {{Part.}} aus·ge·fal·len

{{Aussprache}}
:{{IPA}} {{Lautschrift|ˈaʊ̯sˌfalən}}
:{{Hörbeispiele}} {{Audio|De-ausfallen.ogg}}, {{Audio|De-ausfallen2.ogg}}
:{{Reime}} {{Reim|aʊ̯sfalən|Deutsch}}

{{Bedeutungen}}
:[1] nicht mehr zur Verfügung stehen
::[a] Personen
::[b] Maschinen oder sonstiges
:[2] auf biologischem Wege verlieren
:[3] etwas Geplantes findet nicht statt
::[a] ''Wirtschaft'': eine Verpflichtung nicht einhalten
:[4] ein [[Ergebnis]] [[bewerten]]
:[5] aus der Verteidigung heraus angreifen

{{Herkunft}}
:[[Ableitung]] eines [[Partikelverb]]s zu ''[[fallen]]'' mit der [[Partikel]] ''[[aus]]''

{{Synonyme}}
:[2] [[verlieren]]

{{Gegenwörter}}
:[2] [[behalten]]
:[3] [[stattfinden]]
:[5] [[verteidigen]]

{{Beispiele}}
:[1a] Auf Grund seiner Verletzung wird der Stürmer für die nächsten 3 Wochen ''ausfallen.''
:[1b] Durch den Sturm ''fiel'' in großen Teilen des Landes der Strom ''aus.''
:[1b] [Kernkraftwerk Fukushima/Japan 2011:] „Das Kühlsystem des Kraftwerks ''fiel aus;'' in drei der sechs Reaktoren kam es zur Kernschmelze.“<ref>{{Per-Deutschlandradio | Online=https://www.deutschlandfunk.de/ex-tepco-manager-sollen-wegen-atomkatastrophe-von-fukushima-milliarden-zahlen-100.html | Autor= | Titel=Japan – Ex-Tepco-Manager sollen wegen Atomkatastrophe von Fukushima Milliarden zahlen | TitelErg= | Tag=13 | Monat=07 | Jahr=2022 | Zugriff=2022-07-13 | Kommentar=Sendereihe: Die Nachrichten }}</ref>
:[2] Trotz seines hohen Alters sind ihm bisher noch kaum Haare ''ausgefallen.''
:[3] Wegen der Krankheit des Lehrers ''fiel'' die erste Unterrichtsstunde ''aus.''
:[4] Die Klausur ''fiel'' wesentlich besser als erwartet ''aus.''
:[4] „Laut einem Medienbericht kommt die Preissteigerung zwar später, könnte aber deutlich stärker ''ausfallen.''“<ref>{{Per-Spiegel Online | Online=http://www.spiegel.de/wirtschaft/service/briefporto-soll-laut-medienbericht-spaeter-aber-staerker-steigen-a-1252585.html | Titel=Briefporto soll teurer werden | Tag=10 | Monat=02 | Jahr=2019 | Zugriff=2019-02-11 }}</ref>
:[4] [Corona:] „Die Bilanz liberaler Demokratien in Europa bei der Pandemiebekämpfung ''fällt'' im Vergleich zu den asiatischen Ländern nicht sehr gut ''aus.''“<ref>{{Per-Tagesspiegel Online | Online=https://www.tagesspiegel.de/politik/warum-wir-nicht-von-asiatischen-laendern-lernen-corona-offenbart-die-westliche-arroganz/26893480.html | Autor= Jürgen Gerhards, Michael Zürn | Titel=Warum wir nicht von asiatischen Ländern lernen – Corona offenbart die westliche Arroganz | TitelErg= | Tag=09 | Monat=02 | Jahr=2021 | Zugriff=2021-03-06 | Kommentar= }}</ref>
:[4] „Natürlich erhoffe ich mir von meinem Wutausbruch, dass die Vorgesetzten an mögliche Folgen für ihre Laufbahn denken, falls die Berichterstattung allzu negativ ''ausfällt,'' aber am Ende ist es wohl mehr Mitleid, warum sich ein Biologe seufzend bereiterklärt, uns immerhin an den Rand des Sperrbezirks zu führen.“<ref>{{Per-Zeit | Autor=Navid Kermani | Titel=Unterwegs mit dem Geigerzähler | Nummer=20 | Tag=11 | Monat=05 | Jahr=2017 | Seiten=43 }}</ref>
:[5] Um eine Entscheidung herbeizuführen, planten die Soldaten aus ihrer Stellung ''auszufallen.''

