== ausgelassen ({{Sprache|Deutsch}}) ==
=== {{Wortart|Adjektiv|Deutsch}} ===

{{Deutsch Adjektiv Übersicht
|Positiv=ausgelassen
|Komparativ=ausgelassener
|Komparativ*=ausgelassner
|Superlativ=ausgelassensten
}}

{{Worttrennung}}
:aus·ge·las·sen, {{Komp.}} aus·ge·las·se·ner, aus·ge·lass·ner, {{Sup.}} am aus·ge·las·sens·ten

{{Aussprache}}
:{{IPA}} {{Lautschrift|ˈaʊ̯sɡəlasn̩}}
:{{Hörbeispiele}} {{Audio|De-ausgelassen.ogg}}
:{{Reime}} {{Reim|aʊ̯sɡəlasn̩|Deutsch}}

{{Bedeutungen}}
:[1] in Stimmungen und bei Handlungen unbeschwert fröhlich:
::[a] in überschwänglicher [[Stimmung]] [[befindlich]]
::[b] ''von Personen:'' [[Übermut]] [[auslebend]]
::[c] ''von Kindern:'' ungestümes [[Treiben]] [[vollführend]]
::[d] ''von Feiern:'' [[Freude]] und [[Fröhlichkeit]] [[zelebrierend]]

{{Herkunft}}
:[[Derivation]] ([[Ableitung]]) des [[Verbs]] ''[[auslassen]]'' durch [[Konversion]]

{{Synonyme}}
:[1a] [[ekstatisch]], [[überschäumend]], [[überschwänglich]]
:[1b] [[lebendig]], [[quirlig]], [[munter]]
:[1c] [[heftig]], [[lebhaft]], [[lustig]], [[übermütig]], [[ungestüm]]
:[1d] [[bacchantisch]], [[fröhlich]], [[närrisch]], [[orgiastisch]], [[wild]]

{{Gegenwörter}}
:[1a] [[gehemmt]], [[nüchtern]]
:[1b] [[brav]], [[manierlich]], [[überlegt]]
:[1c] [[sanft]], [[maßvoll]], [[schüchtern]]
:[1d] [[bedächtig]], [[gesittet]], [[nüchtern]], [[traurig]]

{{Beispiele}}
:[1a] Die Stimmung war ''ausgelassen'' wie beim Karneval. Die Teilnehmer zogen hinter Lautsprecherwagen her und tanzten in den Straßen.<ref>{{Per-Presse (Onlineausgabe) | Online=http://www.diepresse.at/home/panorama/welt/309623/index.do | Autor=APA | Titel=Millionen bei Homosexuellenparade in Sao Paulo | Tag=11 | Monat=6 | Jahr=2007 | Zugriff=2012-05-25}}</ref>
:[1a] ''Ausgelassener Jubel'' herrschte hingegen bei den 69.000 Zuschauern in der Münchner Allianz-Arena, das 3:3 gegen Dortmund kümmerte keinen, das Resultat war sekundär, alles drehte sich um die Meisterschale. ''Ausgelassene'' Stimmung vor allem später am Marienplatz, wo die Bayern-Fans ihre Lieblinge hochleben ließen.<ref>{{Per-Presse (Onlineausgabe) | Online=http://www.diepresse.at/home/sport/fussball/90764/index.do | Autor= | Titel=Juve-Skandal: Titelgewinn nur Nebensache | Tag=15 | Monat=5 | Jahr=2006 | Zugriff=2012-05-25}}</ref>
:[1b] Und auf einem römischen Brunnen werden überlebensgroße Götterfiguren lebendig. ''Ausgelassen'' hebt ein marmorner Dionysos sein Glas und ruft beglückt: Hail Caesar! Heil mir, wispert die Besucherin aus Germany, dass meine Augen solche Wunder schauen dürfen.<ref>{{Per-Zeit Online | Online=http://www.zeit.de/2000/01/Das_Hochamt_der_Kopie?page=all | Autor=Rosemarie Noack | Titel=Das Hochamt der Kopie | Nummer=01/2001 | Tag=28 | Monat=12 | Jahr=2000 | Zugriff=2012-05-25 }}</ref>
:[1c] Zwischen den Marktständen Schausteller, Musikanten und seltsame Tiere. Häuser so hoch, dass die Gassen ganz im Schatten liegen, Bänke, auf denen man sitzen und ausruhen kann. Und fröhliche, ''ausgelassene'' Kinder, die vornehme Kleider tragen, wie er sie zu Hause nur von Sonntags-Erwachsenen kennt.<ref>{{Per-Zeit Online | Online=http://www.zeit.de/2002/52/KJ-Luchs | Autor=Andreas C. Knigge | Titel=LUCHS 191 | TitelErg=Literatur | Nummer=52/2002 | Zugriff=2012-05-25 }}</ref>
:[1c] Wenn mit dem Alter die Neugier erlahmt, und die Kinder nicht mehr ''ausgelassen'' spielen, wolle sie keiner mehr haben.<ref>{{Per-Zeit Online | Online=http://www.zeit.de/1999/22/199922.status3_.xml?page=all | Autor=Stefan Willeke | Titel=Diskrete Zeichen | TitelErg=Dossier | Tag=27 | Monat=5 | Jahr=1999 | Zugriff=2012-05-25 }}</ref>
:[1d] Die ''ausgelassenen'' Feiern über den Aufstieg der Schweiz sind in Zürich von Ausschreitungen überschattet worden.<ref>{{Per-Presse (Onlineausgabe) | Online=http://www.diepresse.at/home/sport/fussball/60089/index.do | Autor=Ag. | Titel=WM: Massenfestnahme pöbelnder Fans | Tag=24 | Monat=6 | Jahr=2006 | Zugriff=2012-05-25}}</ref>
