{{Herkunft}}
:von {{gmh.}} ''{{Ü|gmh|hüpfen}}'' „sich im Tanze biegen“<ref>{{Lit-Duden: Universalwörterbuch|A=6}}, Seite 857f</ref>, ''{{Ü|gmh|hupfen}}, {{Ü|gmh|hopfen}},'' verwandt mit {{mlg.}} ''{{Ü|gml|hüppen}},'' {{nds.}} ''{{Ü|nds|hüppen}},'' {{dum.}} ''{{Ü|dum|huppen}}'' und {{nl.}} ''{{Ü|dum|huppen}},'' {{md.}} ''hoppen,'' {{nds.}} ''{{Ü|nds|hoppen}}, {{Ü|nds|huppen}}'', [[altenglisch]] ''{{Ü|ang|hoppian}},'' [[altnordisch]] ''{{Ü|non|hoppa}}'' und [[schwedisch]] ''{{Ü|sv|hoppa}}''; diese Verben setzen teilweise ein [[germanisch]]es {{noredlink|jan-Verb}}, teils ein {{noredlink|on-Verb}} voraus, ähnlich wie bei den Verben [[hoppeln]] und [[hopsen]]; eine Verwandtschaft besteht auch bei ''[[Haufen]], [[Hüfte]]'', [[altnordisch]] ''{{Ü|non|hopa}}'' ‚[[zurückweichen]]‘ und [[lateinisch]] ''{{Ü|la|cubare}}'' ‚[[liegen]]‘, abgeleitet von {{ine.}} ''*{{Ü|ine|keub-}}, *{{Ü|ine|kūb-}}'', einer Erweiterung um den [[Labiallaut]] ‚b‘ von {{ine.}} ''*{{Ü|ine|keu-}}, *{{Ü|ine|keue-}}'' „(den Körper) biegen“ und ‚[[Höhlung]], [[Wölbung]]‘; zum gleichen Wortstamm gehören ''[[Haube]], [[Hobel]], [[hoch]], [[Hocke]], [[Hügel]]''.<ref>{{Lit-Pfeifer: Etymologisches Wörterbuch|A=6}}, Seite 564</ref> Das Wort ist seit dem 12. Jahrhundert belegt.<ref>{{Lit-Kluge: Etymologisches Wörterbuch|A=24}}, Stichwort: ‚hüpfen‘, Seite 428.</ref>

{{Sinnverwandte Wörter}}
:[1] [[hopsen]], [[Hopser]] [[machen]], [[jumpen]], [[hoppeln]]

