:[1] Er ist mit dem jungen Chateauguyon eine Wette eingegangen, welchem von ihnen es zuerst gelinge, den Fuß im Munde das Zimmer auf und nieder zu ''hüpfen.''<ref>{{DiB-Projekt Gutenberg-DE | Online=https://www.projekt-gutenberg.org/cfmeyer/amulett/amu05.html | Autor={{W|Conrad Ferdinand Meyer}} | Titel=Das Amulett | Kapitel=Fünftes Kapitel }}</ref>
:[1] So sprach er, und ''hüpfte'' vor Freude, wie eine junge Ziege im Mayenthau ''hüpft.''<ref>{{DiB-Projekt Gutenberg-DE | Online=https://www.projekt-gutenberg.org/gessner/nidyllen/thyrsism.html | Autor={{W|Salomon Gessner|Salomon Geßner}} | Titel=Neue Idyllen | Kapitel=Thyrsis und Menalkas }}</ref>
